DROP TABLE IF EXISTS `device`;
CREATE TABLE `device` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `device_no` varchar(100) NOT NULL DEFAULT '' COMMENT '设备编号',
  `pin_code` varchar(100) NOT NULL DEFAULT '' COMMENT '设备PIN',
  `type` varchar(50) NOT NULL DEFAULT '' COMMENT '设备类型',
  `spec` varchar(100) NOT NULL DEFAULT '' COMMENT '设备型号/规格',
  `certificate_no` varchar(200) NOT NULL DEFAULT '' COMMENT '合格证号',
  `produce_date` datetime NOT NULL DEFAULT '1000-01-01 00:00:00' COMMENT '生产日期',
  `operation_date` datetime NOT NULL DEFAULT '1000-01-01 00:00:00' COMMENT '投用日期',
  `status` varchar(20) NOT NULL DEFAULT '' COMMENT '设备状态',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '设备名称',
  `full_name` varchar(200) NOT NULL DEFAULT '' COMMENT '设备全称',
  `owner` varchar(100) NOT NULL DEFAULT '' COMMENT '设备负责人',
  `latest_repair_date` datetime NOT NULL DEFAULT '1000-01-01 00:00:00' COMMENT '最后维修日期',
  `remark` varchar(500) NOT NULL DEFAULT '' COMMENT '备注',
  `is_root` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '是否根节点',
  `t_device_id` bigint(20) NOT NULL DEFAULT '0',
  `equipment_name` varchar(500) NOT NULL DEFAULT '' COMMENT '装置',
  `key_name` varchar(50) NOT NULL DEFAULT '' COMMENT '键相',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_device_no` (`device_no`),
  KEY `idx_device_type_status` (`type`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=304 DEFAULT CHARSET=utf8 COMMENT='设备主信息';

